import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import CarCard from './CarCard';

const CarList = ({ cars }) => {
  return (
    <Container>
      <Row>
        {cars.map(car => (
          <Col key={car.id} xs={12} sm={6} md={4} lg={3}>
            <CarCard car={car} />
          </Col>
        ))}
      </Row>
    </Container>
  );
};

export default CarList;
